import React from 'react';
import Child from "../Child/Child.js";
/* imports child */

/* Parent function */
function Parent() {
  function clickAlert() {
    alert("Answer submitted");
  }
  /* calls child function on child click */
  return (
    <div className="app">
      <Child data="Submit" onClick="{clickAlert}" />
    </div>
  );
}

export default Parent;
